Spring-Mongo-Data Update only allows one positional argument?<p>I have a data model with the following structure:</p>

<pre><code>{
    _id: ObjectId(''),
    strs: [
        {
            _id: ObjectId(''),
            nds: [
                {
                    _id: ObjectId(''),
                    title: ''
                },
                .
                .
                .
            ]
        },
        .
        .
        .
    ]
}
</code></pre>

<p>Following query works perfectly fine in <code>mongo</code> shell:</p>

<pre><code>mongo.update({_id: ObjectId(''), 'strs._id': ObjectId(''), 'strs.nds._id': ObjectId('')}, {$set: {'strs.$.nds.$.title': 'new-title'}})
</code></pre>

<p>I am trying to do the same in Spring Boot, I have written the following lines of code:</p>

<pre class="lang-java prettyprint-override"><code>Criteria criteria = new Criteria();
criteria.addOperator(Criteria.where("id").is(id), 
    Criteria.where("strs.id").is(strsId), Criteria.where("strs.nds.id", ndsId));
Query query = new Query().addCriteria(criteria);
Update update = new Update();
update.set("strs.$.nds.$.title", title);
mongoTemplate.findAndModify(query, update, MyModel.class);
</code></pre>

<p>But, this is not working as expected. It's saying that <code>mongo</code> cannot create a <code>title</code> field inside <code>[nds: {...}]</code>. So, I logged the queries <code>MongoTemplate</code> was generating, and it turns out that <code>MongoTemplate</code> was removing the second positional argument <code>$</code> from the query.</p>

<p>This was the generated query:</p>

<pre><code>mongo.update({...}, {$set: {'strs.$.nds.title': 'new-title'}})
</code></pre>

<p>And this was the reason <code>mongo</code> was throwing an exception saying it cannot create a <code>title</code> field in an array.</p>

<p>Am I doing this wrong? Because <code>MongoTemplate</code> is generating an invalid query which is failing (obviously).</p>

