MongoDB query multiple models<p>I have <code>User</code> and <code>Training</code> model. Both hold <code>likes</code> property set to be an array. The idea is that I would like to create some kind of "add-to-favorite" functionality. </p>

<p><strong>User model</strong></p>

<pre><code>likes: [
    {
      type: mongoose.Schema.ObjectId,
      ref: 'Training',
    },
  ],
</code></pre>

<p><strong>Training model</strong></p>

<pre><code>likes: [
    {
      type: mongoose.Schema.ObjectId,
      ref: 'Training',
    },
  ],
</code></pre>

<p>In my controller I created a function which is responsible for populating user id in Training and vice versa. </p>

<pre><code>exports.favoriteTraining = catchAsync(async (req, res, next) =&gt; {
  const user = await User.findById(req.user.id);
  const training = await Training.findById(req.params.id);

  const trainingLikes = training.likes.filter((like) =&gt; {
    return like.toString() === req.user.id;
  });

  if (trainingLikes.length &gt; 0) {
    return next(new AppError('Training already liked', 400));
  }

  user.likes.unshift(req.params.id);
  training.likes.unshift(req.user.id);

  await user.save({ validateBeforeSave: false });
  await training.save({ validateBeforeSave: false });

  res.status(201).json({
    status: 'success',
    data: {
      user,
      training,
    },
  });
});
</code></pre>

<p>Current solution works, but I was wondering if there is any other way where I do not need to query both databases separately. </p>

