MongoDB insertMany and skip duplicates<p>I'm trying to <a href="https://docs.mongodb.com/manual/reference/method/db.collection.insertMany/" rel="noreferrer"><code>insertMany()</code></a> items into my Mongo database but I would like to skip duplicate IDs.<br>
I'm using <code>Node.js</code> and <a href="https://www.npmjs.com/package/mongodb" rel="noreferrer"><code>mongodb</code></a>. </p>

<p>I have some data:</p>

<pre class="lang-js prettyprint-override"><code>const myExampleData = [
   {_id:'someId1', name:'I am example'},
   {_id:'someId2', name:'I am second example'}
];
</code></pre>

<p>and I would like to insert them like this:</p>

<pre class="lang-js prettyprint-override"><code>dbo.collection(collectionName).insertMany(myExampleData).catch(err=&gt;{
    console.error(err);
});
</code></pre>

<p>Lets suppose that <code>someId1</code> already exists. I don't want to override it. I just want to skip it. In current situation it doesn't insert <code>someId2</code>. It stops as soon as it throws duplicate exception.</p>

<p><strong>Is there a way how to insertMany and skip duplicates?</strong></p>

<hr>

<h3>Possible question duplicate.</h3>

<p>I've found thread <a href="https://stackoverflow.com/questions/40664404/mongodb-insert-without-duplicates">MongoDB insert without duplicates</a> where is suggested to use <a href="https://docs.mongodb.com/manual/reference/method/db.collection.update/" rel="noreferrer"><code>update()</code></a> with <a href="https://docs.mongodb.com/manual/reference/method/db.collection.update/#syntax" rel="noreferrer"><code>upsert</code></a> instead of <a href="https://docs.mongodb.com/manual/reference/method/db.collection.insert/" rel="noreferrer"><code>insert()</code></a> which could be fine for one item. But how about many items? As far as I know <a href="https://docs.mongodb.com/manual/reference/method/db.collection.updateMany/" rel="noreferrer"><code>updateMany()</code></a> would update all filtered rows with the same value but I would like to insert different values.</p>

