Mongoose not updating database with findByIdAndUpdate?<p>I am trying to update my database using <code>findByIdAndUpdate</code> through an HTML form, which works for all but the nested data (<code>ePIMS</code>, <code>codeVersion</code>, and <code>region</code> all update with no problem). When I do <code>console.log(req.body.environment.instance)</code>, it outputs the data I typed in like it's going through correctly, but for some reason the mongoDB does not update with the information. Can anyone figure out what I'm doing wrong?</p>

<p>mongoose schema:</p>

<pre class="lang-js prettyprint-override"><code>var environmentSchema = new mongoose.Schema({
    ePIMS: String,
    codeVersion: String,
    region: String,
    /*instance and testEnv don't seem to update in the database*/
    HCHC: {
      instance: String,
      testEnv: String
    }
  });
</code></pre>

<p>form I'm using to update:</p>

<pre class="lang-html prettyprint-override"><code>    &lt;form action="/environments/&lt;%= environment._id %&gt;?_method=PUT" method="POST"&gt;
        &lt;input class="form-control" type="text" name="environment[ePIMS]" placeholder="ePIMS" value="&lt;%= environment.ePIMS %&gt;" /&gt;
        &lt;input class="form-control" type="text" name="environment[region]" placeholder="Region" value="&lt;%= environment.region %&gt;" /&gt;

        &lt;input class="form-control" type="text" name="environment[instance]" placeholder="HCHC Instance" value="&lt;%= environment.instance %&gt;" /&gt;
        &lt;input class="form-control" type="text" name="environment[testEnv]" placeholder="Test Environment" value="&lt;%= environment.testEnv %&gt;" /&gt;
        &lt;button class="btn btn-primary"&gt;Submit&lt;/button&gt;
    &lt;/form&gt;
</code></pre>

<p>edit and update routes:</p>

<pre class="lang-js prettyprint-override"><code>//Edit environment route
  router.get("/environments/:id/edit", function(req, res){
      Environment.findById(req.params.id, function(err, foundEnvironment){
          if(err){
              res.redirect("/");
          } else {
              res.render("edit", {environment: foundEnvironment});
          }
      });
  });

  //Update environment route
router.put("/environments/:id", function(req, res){
  Environment.findByIdAndUpdate(req.params.id, req.body.environment, function(err, updatedEnvironment){
    if (err) {
      res.redirect("/environments");
    } else {
      res.redirect("/environments");
      //console.log(req.body.environment.instance)
    }
  });
});
</code></pre>

<p><strong>UPDATE: SOLUTION</strong>
Thank you Nayan for your help!</p>

<p>I changed the update route like so:</p>

<pre><code> //Update environment route
router.put("/environments/:id", function(req, res){
  var data = {
    HCHC : {
      instance: req.body.instance,
      testEnv: req.body.testEnv
    }
  }
  Environment.findByIdAndUpdate(req.params.id, {$set: data}, function(err, updatedEnvironment){
    if (err) {
      res.redirect("/environments");
    } else {
      res.redirect("/environments");
    }
  });
});
</code></pre>

